import React from "react";

const Footer = () => {
  return (
    <div className="container">
      <div className="row">
        <div>
          <h5 className="fw-bold">Title Here</h5>
          <p>
            Lorem ipsum dolor sit amet, consectetur adipiscing <br /> elit.
            Aliquam at dignissim nunc, id maximus ex. Etiam nec dignissi
            <br />m elit, at dignissim enim. <i class="fab fa-instagram"></i>
            <i class="fab fa-facebook-square"></i>
            <i class="fab fa-twitter-square"></i>
            <i class="fab fa-whatsapp"></i>
          </p>
        </div>

        <div>
          <p>
            History Our Team Brand Guidelines Terms & Condition Privacy Policy
          </p>
        </div>
      </div>
    </div>
  );
};

export default Footer;
